import React, { Component } from 'react';

class InfoModule extends Component {

	constructor(modules){
		super();
		this.modules = modules;
	}

	render(){
		for (const id in this.modules) {
			renderModule(id);
		}
	}

	renderModule(id){
		switch(id){
			case 1:
				return "1";
			case 2:
				return "2";
			default:
				break;
		}
	}
}

export default InfoModule;
